import Box from "@mui/material/Box";
import "./ShowBox.css";
import { useState } from "react";

const ShowBox = () => {
  const [side, siedChage] = useState("right");
  const a = "white";
  const b = "blue";
  return (
    <>
      {side === "left" ? (
        <Box
          className="right-box"
          sx={{
            width: "auto",
            maxWidth: "600px",
            height: "100px",
            alignItems: "center",
            backgroundColor: "#ECD3BF",
            marginLeft: "0px",
          }}
        >
          hello
        </Box>
      ) : (
        <Box
          className="left-box"
          sx={{
            width: "auto",
            maxWidth: "600px",
            height: "100px",
            alignItems: "center",
            backgroundColor: "#ECD3BF",
            margin: "left",
          }}
        >
          hello
        </Box>
      )}

      <Box
        sx={{
          width: "auto",
          height: 500,
          alignItems: "center",
          backgroundColor: "#ECD3BF",
          margin: "auto",
        }}
      ></Box>
    </>
  );
};

export default ShowBox;
